  false,\n\t\"url\": null,\n\t\"notes\": \"Twelve quadrats were sampled along 2 consecutively-placed,
  25m transect lines, as part of Rapid Ecological Assessments, conducted at 10 sites
  at Guam in the Marianas Archipelago from 12 - 22 May 2007, aboard the NOAA ship
  Hi'ialakai, during the Reef Assessment and Monitoring Program (RAMP) Cruise HI0702.
  Raw survey data included genus presence and relative abundance, and voucher specimens.
  Detailed taxonomic analyses of voucher specimens are presented.\",\n\t\"owner_org\":
